import './App.css';

class App extends React.Component {
  constructor(){
    super();
    this.state = {
      tasks : [
        {id:0, title : 'Create todoreact app', done: false},
        {id:1, title : 'Make', done: false},
        {id:2, title : 'chto to', done: false}
      ]
    }
  }

render(){
  const {tasks} = this.state;

  return (
    <div className = "App" >
      <h1 classname = "top">Action tasks : {tasks.length}</h1>
    </div>
  )
}
}


export default App;
